        const{name, value} = event.target;
        setName(value)
    }



    return(

        <div className="header">
        <SearchBar />
        <h1>Seattle</h1>
        <p>fog</p>
        <h2>21°C</h2>
        <div className="pressure">
            <p>Pressue: 1018</p>
            <p> | </p>
            <p>Humidity: 67°C</p>
        </div>
        </div>



    );

}
export default Header
